import React, { Component } from "react";
import { client } from "../../client.js";

class Orders extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    client.get("/orders").then((res) => {
      this.setState({
        orders: res.data,
      });
    });
    console.log(this.state.orders);
  }

  render() {
    return (
      <table class="table p-4">
        <thead>
          <tr>
            <th scope="col">Order Id</th>
            <th scope="col">User Name</th>
            <th scope="col">Email</th>
            <th scope="col">Total</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Orders;
